import React from 'react';

function Story(props){
	const story = [
		{
			story:{
				img:""
			},
			user:{
				username:"NanouBinkz",
				pp:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/67/NasserLawSchool.jpg/170px-NasserLawSchool.jpg"
			}
		},
		{
			story:{
				img:""
			},
			user:{
				username:"NanouBinkz",
				pp:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/67/NasserLawSchool.jpg/170px-NasserLawSchool.jpg"
			}
		},
		{
			story:{
				img:"https://i-det.unimedias.fr/sites/art-de-vivre/files/styles/large/public/plage-anse-perle-guadeloupe.jpg?auto=compress%2Cformat&crop=faces%2Cedges&cs=srgb&fit=crop&h=601&w=900"
			},
			user:{
				username:"NanouBinkz",
				pp:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/67/NasserLawSchool.jpg/170px-NasserLawSchool.jpg"
			}
		},
	]

	const st = story.map(s =>
		<div className="d-flex flex-column align-items-center rounded rounded-5 p-2 bg-dark storyCard position-relative" style={{backgroundImage:`url(${s.story.img})`}}>
			<span className="position-absolute rounded rounded-5 bg-light storyProfile m-2 start-0 top-0" style={{backgroundImage:`url(${s.user.pp})`}}></span>
			<span className="position-absolute mb-3 text-center bottom-0 text-light text-shadow">{s.user.username}</span>						
		</div>
		)

    return (
		<div className="bg-light rounded rounded-5 p-2 mb-2 w-100">
			<div className="d-flex align-items-center w-100 gap-2 overflow-auto">
				{st}
			</div>
		</div>  
    );
}

export default Story;
